function countingValleys(n, s) {
  console.log('in function')
    let numValleys = 0;
    let path = 0;
    s = s.split('');
    for (let num = 0; num < n; num++) {
        if (s[num] == 'U') {
            path += 1;
            //console.log('path in U: ',path);
        }
        else if (s[num] == 'D') {
            if (path == 0 && path - 1 == -1 && num != n-1) {
                numValleys += 1;
                console.log('numvalleys if ',numValleys);
            }
            path -= 1;
            console.log('path in D: ', path);
            /*if (path == 0) {
                numValleys += 1;
                console.log('numvalleys if2 ',numValleys);
            }*/
            if (path < 0) {
                //console.log('numvalleys else if ',numValleys);
                continue;
            }
        }
    }
    //console.log(`Final path is ${path}`);
    console.log(numValleys);
    //return numValleys;
}

const n = 1000000;
const s = '';

countingValleys(n,s);
